import React, { Component } from "react";
import logo from "../img/kölnMap.png";

class Submit extends Component {
  render() {
    return (
      <div class='container' id='infoContainer'>
        <h2 className='dummyText'>Lageplan der Universität zu Köln</h2>
        <div class='row'>
          <div class='one-half column relative' id='gridHalf'>
            <span class='absolute'>
              Finden Sie jedes Gebäude der Universität und Uniklinik Köln.
              <br></br>
              <button id='infoLageplanBtn'>Klick hier!</button>
            </span>
          </div>

          <div class='one-half column' id='gridHalf'>
            <img src={logo} alt='logo' id='cgnMap' />
          </div>
        </div>
        <h2 className='dummyText'>Ein Projekt des geographischen Institutes</h2>
        <div class='container'>
          <div class='row'>
            <div class='one-third column'>Logo Geo</div>
            <div class='two-thirds column'>Hier Input rein</div>
          </div>
        </div>
      </div>
    );
  }
}

export default Submit;
